import React from 'react';
import '../styles/login.component.style.scss';
import navIcons from '../icons/navIcons';

function Login() {
	return (
		<>
			<div className="login-holder flex-col">
				<div className="login-holer_img">
					<img src={navIcons.login} alt="Welcome!" />
				</div>
				<form action="localhost:4200/api/login" method="get">
					<label htmlFor="username">
						{' '}
						username
						<input
							type="text"
							id="username"
							value=""
							peachloader="username"
							name="username"
						/>
					</label>
				</form>
			</div>
		</>
	);
}

export default Login;
